import React from "react";
import { P } from "../../components/PrimaryOutlineButtonWithIcon";
import PrimaryButtonWithIcon from "../../components/PrimaryOutlineButtonWithIcon/PrimaryOutlineButtonWithIcon";

function ReportHeader({ ShareIcon, DownloadIcon, downloadReport }) {
  return (
    <>
      <h5>My Report</h5>
      <div className="btn-div">
        <PrimaryOutlineButtonWithIcon icon={ShareIcon}>
          Share Report
        </PrimaryOutlineButtonWithIcon>
        <PrimaryButtonWithIcon icon={DownloadIcon} onClick={downloadReport}>
          Download Report
        </PrimaryButtonWithIcon>
      </div>
    </>
  );
}

export default ReportHeader;
